import Grid from "@mui/material/Grid";
import SuiTypography from "components/SuiTypography";
import SuiBox from "components/SuiBox";
import Card from "@mui/material/Card";
import SuiSelect from "components/SuiSelect";
import SuiButton from "components/SuiButton";
import 'bootstrap/dist/css/bootstrap.min.css';
import DataTable from "examples/Tables/DataTable";
import breakpoints from "assets/theme/base/breakpoints";


function Overview() {

  const { values } = breakpoints;
  const columns =
  {
    columns: [
      { Header: "Advisor Name", accessor: "product" },
      { Header: "	Monthly Inflow", accessor: "bse" },
      { Header: "Monthly Outflow", accessor: "pan" },
      { Header: "New SIPs Registered", accessor: "a1" },
      { Header: "New Clients Added", accessor: "a2" },
    ],

    rows: [
      {
        product: "Anuraag Advisor",
        bse: "0",
        pan: "0",
        a1: "0",
        a2: "0",
      },
      {
        product: "Testing-Adetee",
        bse: "0",
        pan: "0",
        a1: "0",
        a2: "0",
      },
      {
        product: "Advisor Under Branch",
        bse: "0",
        pan: "0",
        a1: "0",
        a2: "0",
      },
      {
        product: "Advisor Under Branch",
        bse: "0",
        pan: "0",
        a1: "0",
        a2: "0",
      },
      {
        product: "Total",
        bse: "0",
        pan: "0",
        a1: "0",
        a2: "0",
      },
    ],

  }

  const passwordRequirements = [

  ];

  const renderPasswordRequirements = passwordRequirements.map((item, key) => {
    const itemKey = `element-${key}`;

    return (

      <SuiBox key={itemKey} component="li" color="text" fontSize="1.25rem" lineHeight={1}>
        <SuiTypography
          variant="button"
          textColor="text"
          fontWeight="regular"
          verticalAlign="middle"
        >
          {item}
        </SuiTypography>
      </SuiBox>
    );
  });


  return (


    <SuiBox my={3}>
      <SuiBox mb={3} p={1}>
        <SuiTypography
          variant={window.innerWidth < values.sm ? "h3" : "h2"}
          textTransform="capitalize"
          fontWeight="bold"
        >
          Advisor Dashboard (4)
        </SuiTypography>
      </SuiBox>

      <Card id="change-password">

        <SuiBox display="flex" justifyContent="space-between" alignItems="flex-end" flexWrap="wrap">
          <SuiBox component="ul" m={0} pl={3.25} mb={{ xs: 8, sm: 0 }}>
            {renderPasswordRequirements}
          </SuiBox>

        </SuiBox>

        <SuiBox component="form" pb={3} px={3} p={3} mb={15}>

          <Grid container spacing={3}>

            <Grid item xs={12}>
              <Grid container spacing={2}>

                <Grid item xs={12} sm={12}>
                  <Grid container spacing={3}>

                    <Grid item xs={12} sm={4}>
                      <SuiBox
                        display="flex"
                        flexDirection="column"
                        justifyContent="flex-end"
                        height="100%"
                      >
                        <SuiBox mb={1} ml={0.5} lineHeight={0} display="inline-block">
                          <SuiTypography
                            component="label"
                            variant="caption"
                            fontWeight="bold"
                            textTransform="capitalize"

                          >
                            Year
                          </SuiTypography>
                        </SuiBox>
                        <SuiSelect
                          placeholder="Select"
                          options={[
                            { value: "2022", label: "2022" },
                            { value: "2021", label: "2021" },
                            { value: "2020", label: "2020" },
                            { value: "", label: "", isDisabled: true },
                          ]}

                        />
                      </SuiBox>
                    </Grid>

                    <Grid item xs={12} sm={4} >
                      <SuiBox
                        display="flex"
                        flexDirection="column"
                        justifyContent="flex-end"
                        height="100%"
                      >
                        <SuiBox mb={1} ml={0.5} lineHeight={0} display="inline-block">
                          <SuiTypography
                            component="label"
                            variant="caption"
                            fontWeight="bold"
                            textTransform="capitalize"

                          >
                            Month
                          </SuiTypography>
                        </SuiBox>
                        <SuiSelect
                          placeholder="Select"
                          options={[

                            { value: "January", label: "January" },
                            { value: "February", label: "February" },
                            { value: "March", label: "March" },
                            { value: "April", label: "April" },
                            { value: "", label: "", isDisabled: true },
                          ]}
                        />
                      </SuiBox>
                    </Grid>
                    <Grid item xs={12} sm={4}>
                      <SuiBox
                        display="flex"
                        flexDirection="column"
                        justifyContent="flex-end"
                        height="100%"
                      >
                        <SuiButton variant="gradient" buttonColor="dark">
                          Submit
                        </SuiButton>
                      </SuiBox>
                    </Grid>
                  </Grid>
                </Grid>
              </Grid>
            </Grid>
          </Grid>
        </SuiBox>
      </Card>

      <SuiBox component="form" my={3}>
        <Card id="change-password">
          <SuiBox mt={8} mb={2}>
            <SuiBox mb={1} ml={2}>
              <SuiTypography variant="h5" fontWeight="medium">
                Monthly Wise Report
              </SuiTypography>
            </SuiBox>
            <DataTable
              table={columns}
              entriesPerPage={false}
              showTotalEntries={false}
              isSorted={false}
            />
          </SuiBox>
        </Card>
      </SuiBox>

    </SuiBox>
  );
}

export default Overview;
